import React from 'react';
import Header from '../Header/Header';
import Footer from '../footer/Footer';
import AppRouter from '../../router/Routers'; // Corrected import path

const Layout = () => {
  return (
    <>
      <Header />
      <Footer />
      <AppRouter />
    </>
  );
};

export default Layout;
